INSERT INTO `News` VALUES (3,'Акція TM Volle','Зустрічайте суперновинку ТМ Volle - підвісний унітаз з електронним управлінням і вбудованою функцією біде NEMO Rimless (арт. 13-17-777).\r\nПеревагами цієї моделі є вбудована форсунка біде у двох режимах: загальний і делікатний (для жінок), автоматична сушка, функція попереднього омивання чаші, функція економії води та система самоочищення після користування (форсунка і чаша). Доповнює цю багатофункціональність дистанційний пульт управління, безобідкова чаша та тонке сидіння з функцією повільного опускання Slim slow-closing.\r\nРозумний унітаз NEMO Rimless можна замовити на B2B-порталі\r\n',NULL,'18.05.2020','03.23.2021');
